[{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"CurrentModule = MixedModelsMakie\nDocTestSetup = quote\n    using MixedModelsMakie\nend\nDocTestFilters = [r\"([a-z]*) => \\1\", r\"getfield\\(.*##[0-9]+#[0-9]+\"]","category":"page"},{"location":"api/#MixedModelsMakie.jl-API","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"","category":"section"},{"location":"api/#Coefficient-Plots","page":"MixedModelsMakie.jl API","title":"Coefficient Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"coefplot","category":"page"},{"location":"api/#MixedModelsMakie.coefplot","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.coefplot","text":"coefplot(x::MixedModel;\n         conf_level=0.95, vline_at_zero=true, show_intercept=true, attributes...)\ncoefplot(x::MixedModelBootstrap;\n         conf_level=0.95, vline_at_zero=true, show_intercept=true, attributes...)\n\nCreate a coefficient plot of the fixed-effects and associated confidence intervals.\n\nnote: Note\nThis functionality is implemented using Makie recipes and thus there are also additional auto-generated methods for coefplot and coefplot! that may be useful when constructing more complex figures.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nusing MixedModels\nusing MixedModelsMakie\nusing Random\n\nverbagg = MixedModels.dataset(:verbagg)\n\ngm1 = fit(MixedModel,\n          @formula(r2 ~ 1 + anger + gender + btype + situ + (1|subj) + (1|item)),\n          verbagg,\n          Bernoulli();\n          progress=false)\n\ncoefplot(gm1)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"sleepstudy = MixedModels.dataset(:sleepstudy)\n\nfm1 = fit(MixedModel, @formula(reaction ~ 1 + days + (1 + days|subj)), sleepstudy; progress=false)\nboot = parametricbootstrap(MersenneTwister(42), 1000, fm1)\n\ncoefplot(boot; conf_level=0.999, title=\"Custom Title\")","category":"page"},{"location":"api/#Ridge-Plots","page":"MixedModelsMakie.jl API","title":"Ridge Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"ridgeplot","category":"page"},{"location":"api/#MixedModelsMakie.ridgeplot","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.ridgeplot","text":"ridgeplot(x::MixedModelBootstrap;\n          conf_level=0.95, vline_at_zero=true, show_intercept=true,\n          attributes...)\n\nCreate a ridge plot for the bootstrap samples of the fixed effects.\n\nDensities are normalized so that the maximum density is always 1.\n\nThe highest density interval correspoding to conf_level is marked with a bar at the bottom of each density. Setting conf_level=missing removes the markings for the highest density interval.\n\nnote: Note\nThis functionality is implemented using Makie recipes and thus there are also additional auto-generated methods for ridgeplot and ridgeplot! that may be useful when constructing more complex figures.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"ridgeplot(boot)","category":"page"},{"location":"api/#Random-effects-and-group-level-predictions","page":"MixedModelsMakie.jl API","title":"Random effects and group-level predictions","text":"","category":"section"},{"location":"api/#Caterpillar-Plots","page":"MixedModelsMakie.jl API","title":"Caterpillar Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"RanefInfo","category":"page"},{"location":"api/#MixedModelsMakie.RanefInfo","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.RanefInfo","text":"RanefInfo\n\nInformation on random effects conditional modes/means, variances, etc.\n\nUsed for creating caterpillar plots.\n\nnote: Note\nThis functionality may be moved upstream into MixedModels.jl in the near future.\n\n\n\n\n\n","category":"type"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"ranefinfo","category":"page"},{"location":"api/#MixedModelsMakie.ranefinfo","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.ranefinfo","text":"ranefinfo(m::MixedModel)\n\nReturn a NamedTuple{fnames(m), NTuple(k, RanefInfo)} from model m\n\n\n\n\n\nranefinfo(m::MixedModel, gf::Symbol)\n\nReturn a RanefInfo corresponding to the grouping variable gf model m.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"caterpillar","category":"page"},{"location":"api/#MixedModelsMakie.caterpillar","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.caterpillar","text":"caterpillar(m::LinearMixedModel, gf::Symbol; orderby=1, cols=nothing)\n\nReturns a Figure of a \"caterpillar plot\" of the random-effects means and prediction intervals\n\nA \"caterpillar plot\" is a horizontal error-bar plot of conditional means and standard deviations of the random effects.\n\nThe order of the levels on the vertical axes is increasing orderby column of r.ranef, usually the (Intercept) random effects. Setting orderby=nothing will disable sorting, i.e. return the levels in the order they are stored in.\n\nThe display can be restricted to a subset of random effects associated with a grouping variable by specifying cols, either by indices or term names.\n\nnote: Note\norderby is the nth column of the columns specified by cols.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"caterpillar!","category":"page"},{"location":"api/#MixedModelsMakie.caterpillar!","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.caterpillar!","text":"caterpillar!(f::Union{Makie.FigureLike,Makie.GridLayout}, r::RanefInfo;\n            orderby=1, cols=nothing)\ncaterpillar!(f::Union{Makie.FigureLike,Makie.GridLayout}, m::LinearMixedModel,\n             gf::Symbol=first(fnames(m)); orderby=1, cols=nothing)\n\nAdd Axes of a caterpillar plot from r to f.\n\nThe order of the levels on the vertical axes is increasing orderby column of r.ranef, usually the (Intercept) random effects. Setting orderby=nothing will disable sorting, i.e. return the levels in the order they are stored in.\n\nThe display can be restricted to a subset of random effects associated with a grouping variable by specifying cols, either by indices or term names.\n\nnote: Note\nEven when not sorting the levels, they might have already been sorted during model matrix construction. If you want impose a particular ordering on the levels, then you must sort the relevant fields in the RanefInfo object before calling caterpillar!.\n\nnote: Note\norderby is the nth column of the columns specified by cols.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nCairoMakie.activate!(type = \"svg\")\nusing MixedModels\nusing MixedModelsMakie\nsleepstudy = MixedModels.dataset(:sleepstudy)\nverbagg = MixedModels.dataset(:verbagg)\n\nfm1 = fit(MixedModel, @formula(reaction ~ 1 + days + (1 + days|subj)), sleepstudy; progress=false)\ngm0 = fit(MixedModel,\n          @formula(r2 ~ 1 + anger + gender + btype + situ + (1|subj) + (1|item)),\n          verbagg,\n          Bernoulli();\n          progress=false)\n\nsubjre = ranefinfo(fm1)[:subj]\n\ncaterpillar!(Figure(; resolution=(800,600)), subjre)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"caterpillar!(Figure(; resolution=(800,600)), subjre; orderby=2)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"caterpillar!(Figure(; resolution=(800,600)), subjre; orderby=nothing)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"caterpillar(gm0, :item)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar","category":"page"},{"location":"api/#MixedModelsMakie.qqcaterpillar","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.qqcaterpillar","text":"qqcaterpillar(m::LinearMixedModel, gf::Symbol=first(fnames(m)); cols=nothing, orderby=1)\n\nReturns a Figure of a \"qq-caterpillar plot\" of the random-effects means and prediction intervals.\n\nThe display can be restricted to a subset of random effects associated with a grouping variable by specifying cols, either by indices or term names.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar!","category":"page"},{"location":"api/#MixedModelsMakie.qqcaterpillar!","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.qqcaterpillar!","text":"qqcaterpillar!(f::Union{Makie.FigureLike,Makie.GridLayout}, r::RanefInfo; cols=nothing)\nqqcaterpillar!(f::Union{Makie.FigureLike,Makie.GridLayout}, m::LinearMixedModel,\n               gf::Symbol=first(fnames(m)); cols=nothing)\n\nUpdate the figure with a caterpillar plot with the vertical axis on the Normal() quantile scale.\n\nThe display can be restricted to a subset of random effects associated with a grouping variable by specifying cols, either by indices or term names.\n\nThe order of the levels on the vertical axes is increasing orderby column of r.ranef, usually the (Intercept) random effects. Setting orderby=nothing will disable sorting, i.e. return the levels in the order they are stored in.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar(fm1)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar(gm0, :item)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar!(Figure(; resolution=(400,300)), subjre; cols=[1])","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"qqcaterpillar!(Figure(; resolution=(400,300)), subjre; cols=[:days])","category":"page"},{"location":"api/#Shrinkage-Plots","page":"MixedModelsMakie.jl API","title":"Shrinkage Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"shrinkageplot\nshrinkageplot!","category":"page"},{"location":"api/#MixedModelsMakie.shrinkageplot","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.shrinkageplot","text":"shrinkageplot(m::MixedModel, gf::Symbol=first(fnames(m)), θref, args...; kwargs...)\n\nReturn a scatter-plot matrix of the conditional means, b, of the random effects for grouping factor gf.\n\nTwo sets of conditional means are plotted: those at the estimated parameter values and those at θref. The default θref results in Λ being a very large multiple of the identity.  The corresponding conditional means can be regarded as unpenalized.\n\nargs... and kwargs... are passed on to shrinkageplot!\n\n\n\n\n\n","category":"function"},{"location":"api/#MixedModelsMakie.shrinkageplot!","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.shrinkageplot!","text":"shrinkageplot!(f::Union{Makie.FigureLike,Makie.GridLayout}, m::MixedModel, gf::Symbol=first(fnames(m)), θref;\n               ellipse=false, ellipse_scale=1, n_ellipse=5)\n\nReturn a scatter-plot matrix of the conditional means, b, of the random effects for grouping factor gf.\n\nTwo sets of conditional means are plotted: those at the estimated parameter values and those at θref. The default θref results in Λ being a very large multiple of the identity.  The corresponding conditional means can be regarded as unpenalized.\n\nCorrelation ellipses can be added with ellipse=true, with the number of ellipses controlled by n_ellipse. The ellipses are equally spaced between the outer ellipse and the origin (center). The scaling of the ellipses can be adjusted with the multiplicative ellipse_scale. If you are unable to see the ellipses, try increasing ellipse_scale.\n\nnote: Note\nFor degenerate (singular) models, the correlation ellipse will also be degenerate, i.e., collapse to a point or line.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nusing MixedModels\nusing MixedModelsMakie\nsleepstudy = MixedModels.dataset(:sleepstudy)\nverbagg = MixedModels.dataset(:verbagg)\n\nfm1 = fit(MixedModel, @formula(reaction ~ 1 + days + (1 + days|subj)), sleepstudy; progress=false)\nshrinkageplot(fm1)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"shrinkageplot(fm1; ellipse=true)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"shrinkageplot!(Figure(; resolution=(400,400)), fm1)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"gm1 = fit(MixedModel,\n          @formula(r2 ~ 1 + anger + gender + btype + situ + (1|subj) + (1+gender|item)),\n          verbagg,\n          Bernoulli();\n          progress=false)\nshrinkageplot(gm1, :item)","category":"page"},{"location":"api/#Diagnostics","page":"MixedModelsMakie.jl API","title":"Diagnostics","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"We have also provided a few useful plot recipes for common plot types applied to mixed models. These are especially useful for diagnostics and model checking.","category":"page"},{"location":"api/#QQ-Plots","page":"MixedModelsMakie.jl API","title":"QQ Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"The methods for qqnorm and qqplot are implemented using Makie recipes. In other words, these are convenience wrappers for calling the relevant plotting methods on residuals(model).","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"Specify the type of line on the QQ plots with the qqline keyword-argument. The default for qqnorm is :fitrobust, which delivers an R-style line connecting the first and third quartiles. The default for qqplot is :identity, which plots the line with slope = 1 and intercept = 0. The final possiblity is :fit, which plots the line of best fit (i.e. regressing the quantiles of the residuals onto the quantiles of the reference distribution).","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"The reference distribution for qqnorm is the standard normal, which differs from the behavior in previous versions of Makie.","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"compat: Compat\nThe options and associated names for the qqline keyword argument changed in Makie 0.16.3 (and were broken in Makie 0.16.0-0.16.2). The equivalent to qqline=:R is qqline=:fitrobust. qqline=:R will be supported for backwards compatibility only until the next breaking release.","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nusing MixedModels\nusing MixedModelsMakie\n\nsleepstudy = MixedModels.dataset(:sleepstudy)\n\nfm1 = fit(MixedModel, @formula(reaction ~ 1 + days + (1 + days|subj)), sleepstudy; progress=false)\nqqnorm(fm1; qqline=:fitrobust)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"# the residuals should have mean 0\n# and standard deviation equal to the residual standard deviation\nqqplot(Normal(0, fm1.σ), fm1)","category":"page"},{"location":"api/#Profile-Plots","page":"MixedModelsMakie.jl API","title":"Profile Plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"Requires MixedModels 4.14 or above.","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nusing MixedModels\nusing MixedModelsMakie\n\nsleepstudy = MixedModels.dataset(:sleepstudy)\nfm1 = fit(MixedModel, @formula(reaction ~ 1 + days + (1 + days|subj)), sleepstudy; progress=false)\npr1 = profile(fm1)\nzetaplot(pr1)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"# show zeta on the absolute value scale with coverage intervals\nzetaplot(pr1; absv=true)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"# show zeta for the variance components\nzetaplot(pr1; absv=true, ptyp='θ')","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"profiledensity(pr1)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"profiledensity(pr1; share_y_scale=false)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"profiledensity(pr1; ptyp='σ')","category":"page"},{"location":"api/#General-plots","page":"MixedModelsMakie.jl API","title":"General plots","text":"","category":"section"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"We also provide a splom or scatter-plot matrix plot for data frames with numeric columns (i.e. a matrix of all pairwise plots). These plots can be used to visualize the joint distribution of, say, the parameter estimates from a simulation.","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"splom!","category":"page"},{"location":"api/#MixedModelsMakie.splom!","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.splom!","text":"splom!(f::Union{Makie.FigureLike,Makie.GridLayout}, df::DataFrame)\n\nCreate a scatter-plot matrix in f from the columns of df.\n\nNon-numeric columns are ignored.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using CairoMakie\nusing DataFrames\nusing LinearAlgebra\nusing MixedModelsMakie\n\ndata = rmul!(randn(100, 3), LowerTriangular([+1 +0 +0;\n                                             +1 +1 +0;\n                                             -1 -1 +1]))\ndf = DataFrame(data, [:x, :y, :z])\n\nsplom!(Figure(; resolution=(800, 800)), df)","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"Meanwhile, splomaxes! provides a lower-level backend for splom!","category":"page"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"splomaxes!","category":"page"},{"location":"api/#MixedModelsMakie.splomaxes!","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.splomaxes!","text":"splomaxes!(f::Union{Makie.FigureLike,Makie.GridLayout}, labels::AbstractVector{<:AbstractString},\n           panel!::Function, args...;\n           extraticks::Bool=false, kwargs...)\n\nPopulate f with a set of (k*(k-1))/2 axes in a lower triangle for all pairs of labels, where k is the length of labels.  The panel! function should have the signature panel!(ax::Axis, i::Integer, j::Integer, args...; kwargs...) and should draw the [i,j] panel in ax.\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"MixedModelsMakie.jl API","title":"MixedModelsMakie.jl API","text":"using Statistics\n\nmat = Array(df)\nfunction pfunc(ax, i, j)\n    # note that this references mat from the outer scope!\n    # [j, i] because:\n    # - i is the row in the figure, which corresponds to the y var in each panel\n    # - j is the col in the figure, which corresponds to the x var in each panel\n    v = view(mat, :, [j, i])\n    scatter!(ax, v; color=(:blue, 0.2))\n    cc = cor(eachcol(v)...)\n    cc = round(cc; digits=2)\n    text!(ax, \"r=$(cc)\")\n    return ax\nend\nsplomaxes!(Figure(; resolution=(800, 800)),\n           names(df), pfunc)","category":"page"},{"location":"#MixedModelsMakie.jl-Documentation","page":"MixedModelsMakie.jl Documentation","title":"MixedModelsMakie.jl Documentation","text":"","category":"section"},{"location":"","page":"MixedModelsMakie.jl Documentation","title":"MixedModelsMakie.jl Documentation","text":"CurrentModule = MixedModelsMakie","category":"page"},{"location":"","page":"MixedModelsMakie.jl Documentation","title":"MixedModelsMakie.jl Documentation","text":"MixedModelsMakie.jl is a Julia package providing plotting capabilities for models fit with MixedModels.jl.","category":"page"},{"location":"","page":"MixedModelsMakie.jl Documentation","title":"MixedModelsMakie.jl Documentation","text":"Note that the functionality here is currently early alpha development and so breaking changes are expected as we refine the interface. Following SemVer, these minor releases before 1.0 can introduce these breaking changes. The release of 1.0 will be indication that we believe the interface is reasonably stable.","category":"page"},{"location":"","page":"MixedModelsMakie.jl Documentation","title":"MixedModelsMakie.jl Documentation","text":"Pages = [\n        \"api.md\",\n]\nDepth = 1","category":"page"}]
